    false,nt"url": null,nt"notes": "The Austin Energy Regional Science Festival
    is one of the largest regional science festivals held in Texas and the nation. Middle
    and high school students who win at their respective schools compete at the regional
    festival to advance to the state science fair competition. Five senior level projects
    receive Best of Fair awards and the winners of those projects have the option to
    advance directly to the international competition. rnrnCentral Texas middle and
    high school students have performed very well at past state and international competitions.
    Between 2004 and 2016, 100 students representing 71 projects advanced to the international
    level. Of those, 44 students representing 29 projects won 73 category and special
    awards. Since 2004, more than 1,225 students have advanced to the state level, where
    about 20% have won awards.rnrnIn 2016, the Austin Energy Regional Science Festival
    showcased 755 middle and high school projects. Unlike most regional events, Austin
    Energy also hosts elementary school students.  Nearly 4,000 students and their families
    turn out for the event which includes a public viewing of the science projects as
    well as educational booths and scientific demonstrations. rnrnOver 550 judges and
    180 volunteers from the City of Austin, local businesses, colleges, and elementary/middle/high
    schools contribute annually to the eventu2019s success. Revenues to fund the event
    come from fees paid by participating schools and companies that provide sponsorships.",nt"license_title":
